import Highlight from '../Highlight';

export default function Hero() {

  const code = `
    const foo = 'bar';
    let count = 0;
    count += 1;
    console.log('Foo:', foo);
  `;
  return (
    <div className="hero">
      <h1>Javascript</h1>
      <Highlight>
        <pre>
          <code language="javascript">
            {code}
          </code>
        </pre>
      </Highlight>
    </div>
  )
}
